@PJACaytonPhD Gusto lang din ng government magpadine-in at magshopping ang mga tao. At tourism. Nevermind the virus... as long as spending happens. 

That's their priority. 

Di nila gets na people will not spend if they are afraid of getting sick while going out. Well, the sane/decent people.

